'From Squeak3.6beta of ''4 July 2003'' [latest update: #5352] on 20 July 2003 at 11:28:48 am'!"Change Set:		MorphExtensionPrintFix-nkDate:			20 July 2003Author:			Ned KonzThis fixes a little bug introduced in MCP cleaning that would cause Morphs with no extension to get a DNU in printOn:"!!MorphExtension methodsFor: 'printing' stamp: 'nk 7/20/2003 11:00'!printOn: aStream 	"Append to the argument, aStream, a sequence of characters that 	identifies the receiver." 	super printOn: aStream.	aStream nextPutAll: ' ' , self identityHashPrintString.	locked == true		ifTrue: [aStream nextPutAll: ' [locked] '].	visible == false		ifTrue: [aStream nextPutAll: '[not visible] '].	sticky == true		ifTrue: [aStream nextPutAll: ' [sticky] '].	balloonText		ifNotNil: [aStream nextPutAll: ' [balloonText] '].	balloonTextSelector		ifNotNil: [aStream nextPutAll: ' [balloonTextSelector: ' , balloonTextSelector printString , '] '].	externalName		ifNotNil: [aStream nextPutAll: ' [externalName = ' , externalName , ' ] '].	isPartsDonor == true		ifTrue: [aStream nextPutAll: ' [isPartsDonor] '].	player		ifNotNil: [aStream nextPutAll: ' [player = ' , player printString , '] '].	eventHandler		ifNotNil: [aStream nextPutAll: ' [eventHandler = ' , eventHandler printString , '] '].	(self hasOtherProperties not or: [ self otherProperties isEmpty ])		ifTrue: [^ self].	aStream nextPutAll: ' [other: '.	self otherProperties		keysDo: [:aKey | aStream nextPutAll: ' (' , aKey , ' -> ' , (self otherProperties at: aKey) printString , ')'].	aStream nextPut: $]! !